export default (state = [], action) => {
  console.log('test_redux-reducer', state, action)
	switch (action.type) {
		case 'INIT_SCHEDULE':
			return state;

		case 'LOAD_SCHEDULE':
			return 'Test';

		case 'LOAD_SCHEDULE_FAILURE':
			return ;

		case 'LOAD_SCHEDULE_SUCCESS':
			return action.payload;

		default:
			return {a:1};
	}
};
